import React, { Component } from "react";
import { NavLink } from "react-router-dom";

export default class FooterNavigation extends Component {
  render() {
    return (
      <ul>
        <li>
          <NavLink to={`${this.props.match.path}/cast`}>Cast</NavLink>
        </li>
        <li>
          <NavLink to={`${this.props.match.path}/reviews`}>Reviews</NavLink>
        </li>
      </ul>
    );
  }
}
